INSERT INTO `manobras-processo` VALUES (45,'Rerun parcial na unidade 1200',1,711241,157,'\"[{\\\"unidade\\\":{\\\"name\\\":\\\"manobra[unidade]\\\",\\\"value\\\":\\\"1\\\",\\\"type\\\":\\\"select-one\\\",\\\"required\\\":false}},{\\\"nome\\\":{\\\"name\\\":\\\"manobra[nome]\\\",\\\"value\\\":\\\"Rerun parcial na unidade 1200\\\",\\\"type\\\":\\\"text\\\",\\\"required\\\":false}},{\\\"alertas\\\":[{\\\"setp\\\":\\\"0\\\",\\\"relatrio\\\":true,\\\"equipamento\\\":false,\\\"name\\\":\\\"\\\",\\\"equipamento_id\\\":\\\"\\\",\\\"texto\\\":\\\"\\\"},{\\\"setp\\\":\\\"1\\\",\\\"relatrio\\\":false,\\\"equipamento\\\":true,\\\"name\\\":\\\"P-1201 B\\\",\\\"equipamento_id\\\":\\\"6\\\",\\\"texto\\\":\\\"\\\"},{\\\"setp\\\":\\\"2\\\",\\\"relatrio\\\":true,\\\"equipamento\\\":true,\\\"name\\\":\\\"P-1401 A\\\",\\\"equipamento_id\\\":\\\"4\\\",\\\"texto\\\":\\\"\\\"}],\\\"steps\\\":[{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"dfgsdgsdfg sdfgsdf gsdg\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"werwerwerr\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"werwerwrwer\\\"}]}]\"',NULL,'\"\"'),(47,'dfgbdfggsdfgsd',1,711241,149,'\"[{\\\"unidade\\\":{\\\"name\\\":\\\"manobra[unidade]\\\",\\\"value\\\":\\\"1\\\",\\\"type\\\":\\\"select-one\\\",\\\"required\\\":false}},{\\\"nome\\\":{\\\"name\\\":\\\"manobra[nome]\\\",\\\"value\\\":\\\"dfgbdfggsdfgsd\\\",\\\"type\\\":\\\"text\\\",\\\"required\\\":false}},{\\\"alertas\\\":[],\\\"steps\\\":[{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"aergearwerrwer\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"werwerwerr\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"werwerwrwer\\\"}]}]\"',NULL,'\"\"'),(44,'Procedimento de Lavagem do E-1351',1,711241,154,'\"[{\\\"unidade\\\":{\\\"name\\\":\\\"manobra[unidade]\\\",\\\"value\\\":\\\"1\\\",\\\"type\\\":\\\"select-one\\\",\\\"required\\\":false}},{\\\"nome\\\":{\\\"name\\\":\\\"manobra[nome]\\\",\\\"value\\\":\\\"Procedimento de Lavagem do E-1351\\\",\\\"type\\\":\\\"text\\\",\\\"required\\\":false}},{\\\"alertas\\\":[{\\\"setp\\\":\\\"0\\\",\\\"relatrio\\\":true,\\\"equipamento\\\":false,\\\"name\\\":\\\"\\\",\\\"equipamento_id\\\":\\\"\\\",\\\"texto\\\":\\\"N\\u00e3o esquecer de arrancar a P-1407\\\"}],\\\"steps\\\":[{\\\"title\\\":\\\"Enchimento lado carca\\u00e7a\\\",\\\"step\\\":\\\"Assegurar que as v\\u00e1lvulas V7(n\\u00edvel de n\\u00edvel dos tubos) est\\u00e3o abertas, vent U1, E2 e\\\\nS1 est\\u00e3o abertas e todas as outras v\\u00e1lvulas est\\u00e3o fechadas.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Iniciar a bomba de alimenta\\u00e7\\u00e3o.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvulas V1 depois a V2 para iniciar o enchimento o lado da carca\\u00e7a\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Monitorizar o n\\u00edvel da solu\\u00e7\\u00e3o de lavagem no tubo de pl\\u00e1stico transparente ligado a\\\\nP2 (via V7).\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando o n\\u00edvel do lado da carca\\u00e7a chegar ao n\\u00edvel requerido fechar a v\\u00e1lvula V2.\\\"},{\\\"title\\\":\\\"Enchimento do lado da alimenta\\u00e7\\u00e3o combinada\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvula V3 para iniciar o enchimento do lado da alimenta\\u00e7\\u00e3o combinada.\\\\nComo o volume de carga combinada \\u00e9 muito inferior relativamente ao da carca\\u00e7a o\\\\nn\\u00edvel subir\\u00e1 mais r\\u00e1pido que o da carca\\u00e7a.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Monitorizar o n\\u00edvel da solu\\u00e7\\u00e3o de lavagem no tubo de pl\\u00e1stico transparente ligado ao\\\\nbocal auxiliar na entrada de carga combinada (via V6)\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando o n\\u00edvel do lado da alimenta\\u00e7\\u00e3o combinada estiver aproximadamente em 300\\\\nmm ( 1 p\\u00e9), abaixo do n\\u00edvel da solu\\u00e7\\u00e3o no lado da carca\\u00e7a, fechar V3.\\\\nNota: Assegurar que o n\\u00edvel no lado da alimenta\\u00e7\\u00e3o combinada do permutador nunca\\\\n\\u00e9 superior ao n\\u00edvel do lado da carca\\u00e7a para evitar press\\u00e3o inversa no feixe\\\"},{\\\"title\\\":\\\"Enchimento do lado do efluente\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvula V4 para iniciar o enchimento o lado do afluente.\\\\nComo o volume do lado do efluente \\u00e9 muito inferior ao volume do lado da carca\\u00e7a, o\\\\naumento do n\\u00edvel \\u00e9 mais r\\u00e1pido.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Monitorizar o n\\u00edvel da solu\\u00e7\\u00e3o de lavagem no tubo de pl\\u00e1stico transparente ligado \\u00e0\\\\nsa\\u00edda do efluente (via V5)\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando o n\\u00edvel do lado do efluente estiver aproximadamente em 300 mm ( 1 p\\u00e9),\\\\nabaixo do n\\u00edvel da solu\\u00e7\\u00e3o no lado da carca\\u00e7a&alimenta\\u00e7\\u00e3o combinada, fechar V4.\\\\nNota: Assegurar que o n\\u00edvel no lado da alimenta\\u00e7\\u00e3o combinada do permutador nunca\\\\n\\u00e9 superior ao n\\u00edvel do lado da carca\\u00e7a & alimenta\\u00e7\\u00e3o combinada para evitar press\\u00e3o\\\\ninversa no feixe\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Parar a bomba de alimenta\\u00e7\\u00e3o e fechar a v\\u00e1lvula V1.\\\"},{\\\"title\\\":\\\"Borbulhar do Azoto\\\",\\\"step\\\":\\\"Fechar v\\u00e1lvulas V5 e V6 (para evitar a projec\\u00e7\\u00e3o de liquido durante o borbulhar).\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvulas V8 e V9 para iniciar o borbulhar do azoto.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Manter o borbulhar com N2 durante todos os procedimentos da lavagem, incluindo o\\\\nvazamento, fechar v\\u00e1lvulas V8 e V9.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvulas V5 e V6.\\\"},{\\\"title\\\":\\\"Vazamento do lado do efluente\\\\nPrecau\\u00e7\\u00f5es: Primeiro purgar o lado do efluente\\\",\\\"step\\\":\\\"Assegurar que todos os vents (U1, S2 e E2) est\\u00e3o abertos, e todas as v\\u00e1lvulas est\\u00e3o\\\\nfechadas\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Assegurar que todos os vents (U1, S2 e E2) est\\u00e3o abertos, e todas as v\\u00e1lvulas est\\u00e3o\\\\nfechadas.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvulas V4 e V8 para purgar o lado do efluente.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Durante a drenagem tirar uma amostra do liquido na v\\u00e1lvula V11 (no inicio, a meio e\\\\nno fim da drenagem).\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando o lado do efluente vazio, fechar v\\u00e1lvulas V4 e V8 para o azoto borbulhar.\\\"},{\\\"title\\\":\\\"Vazamento do lado da alimenta\\u00e7\\u00e3o combinada\\\\nPrecau\\u00e7\\u00f5es: Purgar o lado da alimenta\\u00e7\\u00e3o depois do lado do efluente estar vazio\\\",\\\"step\\\":\\\"Assegurar que todos os vents (U1, S2 e E2) est\\u00e3o abertos, todas as outras v\\u00e1lvulas\\\\nest\\u00e3o fechadas.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvulas V3 e V9.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Durante a drenagem tirar uma amostra do liquido na v\\u00e1lvula V11 ( no inicio, a meio e\\\\nno fim da drenagem).\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando o lado da alimenta\\u00e7\\u00e3o combinada vazio, fechar v\\u00e1lvulas V3 e V9.\\\"},{\\\"title\\\":\\\"Vazamento da Carca\\u00e7a\\\\nPrecau\\u00e7\\u00f5es: Purgar o lado da carca\\u00e7a depois dos lados do efluente e da alimenta\\u00e7\\u00e3o da\\\\nalimenta\\u00e7\\u00e3o combinada estarem vazios\\\",\\\"step\\\":\\\"Assegurar que todos os vents (U1, S2 e E2) est\\u00e3o abertos, e todas as v\\u00e1lvulas est\\u00e3o\\\\nfechadas.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir v\\u00e1lvula V2.\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Durante a drenagem tirar uma amostra do liquido na v\\u00e1lvula V11 ( no inicio, a meio e\\\\nno fim da drenagem).\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Quando lado da carca\\u00e7a estiver vazio, fechar v\\u00e1lvula V2.\\\"}]}]\"',NULL,'\"<p style=\\\"text-align:center\\\">1. Introdu&ccedil;&atilde;o<br \\/>\\nEste documento d&aacute; recomenda&ccedil;&otilde;es para um procedimento de lavagem do permutador<br \\/>\\nPACKINOX.<br \\/>\\nEste procedimento reflecte a experi&ecirc;ncia de campo adquirida pelo departamento de<br \\/>\\nassist&ecirc;ncia ao cliente em diversas instala&ccedil;&otilde;es.<br \\/>\\nV&aacute;rios t&oacute;picos s&atilde;o discutidos neste procedimento:<br \\/>\\n- M&eacute;todos de limpeza qu&iacute;mica<br \\/>\\n- Procedimento de enchimento e vazamento<br \\/>\\n- Lavagem<br \\/>\\n- Secagem<br \\/>\\n2. M&eacute;todo de lavagem qu&iacute;mica<br \\/>\\nExistem 2 m&eacute;todos poss&iacute;veis para lavar quimicamente o permutador PACKINOX:<br \\/>\\n- M&eacute;todo de enchimento e vazamento (carca&ccedil;a, lado da alimenta&ccedil;&atilde;o combinada e<br \\/>\\nlado efluente s&atilde;o lavados e purgados independentemente);<br \\/>\\n- M&eacute;todo de circula&ccedil;&atilde;o<br \\/>\\nEste pode ser usado para simplesmente lavar o lado da carca&ccedil;a ou o lado da<br \\/>\\nalimenta&ccedil;&atilde;o ou ainda o lado do efluente, ou para lavar carca&ccedil;a + alimenta&ccedil;&atilde;o<br \\/>\\ncombinada + lado do efluente ( neste caso carca&ccedil;a + lado da alimenta&ccedil;&atilde;o<br \\/>\\ncombinada + lado do efluente s&atilde;o conectados paralelamente).<br \\/>\\nA escolha do m&eacute;todo mais adequado depende da instala&ccedil;&atilde;o, do equipamento dispon&iacute;vel,<br \\/>\\ndos produtos qu&iacute;micos usados, compartimentos a serem lavados.<\\/p>\\n\\n<div style=\\\"background:rgb(238, 238, 238); border:1px solid rgb(204, 204, 204); padding:5px 10px; text-align:center\\\">Press&otilde;es da Carca&ccedil;a &amp; Ambos os lados da alimenta&ccedil;&atilde;o combinada<br \\/>\\nT&Ecirc;M QUE SER SEMPRE SUPERIORES<br \\/>\\n&agrave; press&atilde;o do lado do efluente<\\/div>\\n\\n<p>&nbsp;<\\/p>\\n\\n<p>&nbsp;<\\/p>\\n\\n<p>3. M&eacute;todo de enchimento e vazamento<br \\/>\\nO permutador PACKINOX tem de ser preparado conforme o esquema em anexo no<br \\/>\\nAp&ecirc;ndice n.&ordm; 2.<br \\/>\\n3.1. Liga&ccedil;&otilde;es:<br \\/>\\n3.1.1. Bocal de pressuriza&ccedil;&atilde;o (P):<br \\/>\\nDeve ser equipado com flange cega manufacturada com:<br \\/>\\n- Um bocal de &frac34; a 1&rdquo; de di&acirc;metro para a liga&ccedil;&atilde;o de um tubo de pl&aacute;stico<br \\/>\\ntransparente (tubo de n&iacute;vel de liquido) e uma v&aacute;lvula V7.<br \\/>\\n3.1.2. Entrada de carga combinada (E1)<br \\/>\\nO bocal de entrada do g&aacute;s de reciclo (E1) deve ser equipado com flange<br \\/>\\ncega (ver figura) equipada com:<br \\/>\\n- Um bocal de 3 a 4&rdquo; de di&acirc;metro para enchimento e drenagem da<br \\/>\\ncarca&ccedil;a + lado o lado da alimenta&ccedil;&atilde;o combinada, e uma v&aacute;lvula V3;<br \\/>\\n- Um bocal de &frac34; a 1&rdquo; de di&acirc;metro para injec&ccedil;&atilde;o de N2 e uma v&aacute;lvula<br \\/>\\nV9;<br \\/>\\n- Um tubo de pl&aacute;stico transparente de &frac34; a 1&rdquo; de di&acirc;metro (tubo de n&iacute;vel<br \\/>\\nde liquido) e uma v&aacute;lvula V6 ligados ao bocal auxiliar A1.<br \\/>\\n3.1.3. Drenagem<\\/p>\\n\\n<p>&nbsp;<\\/p>\\n\"'),(43,'Mudança de run na U-1400 para JET A1',3,711241,154,'\"[{\\\"unidade\\\":{\\\"name\\\":\\\"manobra[unidade]\\\",\\\"value\\\":\\\"3\\\",\\\"type\\\":\\\"select-one\\\",\\\"required\\\":false}},{\\\"nome\\\":{\\\"name\\\":\\\"manobra[nome]\\\",\\\"value\\\":\\\"Mudan\\u00e7a de run na U-1400 para JET A1\\\",\\\"type\\\":\\\"text\\\",\\\"required\\\":false}},{\\\"alertas\\\":[null,{\\\"setp\\\":\\\"1\\\",\\\"relatrio\\\":true,\\\"equipamento\\\":false,\\\"texto\\\":\\\"N\\u00e3o esquecer de arrancar a P-1407\\\"},{\\\"setp\\\":\\\"2\\\",\\\"relatrio\\\":false,\\\"equipamento\\\":true,\\\"name\\\":\\\"P-1407\\\",\\\"equipamento_id\\\":\\\"16\\\",\\\"texto\\\":\\\"\\\"}],\\\"steps\\\":[{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Avisar a MOV sobre a manobra\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Abrir saida da unidaded para JET A1\\\"},{\\\"title\\\":\\\"\\\",\\\"step\\\":\\\"Arrancar a P-1407\\\"}]}]\"',NULL,'\"<p>Breve descri&ccedil;&atilde;o sobre a mudan&ccedil;a de run da U-1400<\\/p>\\n\"');
